static void *ARCONTROLLER_Device_PompLoopThread (void *arg)
{
    ARCONTROLLER_Device_t *deviceController = arg;
    while (!deviceController->privatePart->pomp_stop)
        pomp_loop_wait_and_process(deviceController->privatePart->loop, -1);
    return NULL;
}
