void *ARCONTROLLER_Device_ControllerLooperThread (void *data)
{
    // -- Sending Looper Thread --

    eARCONTROLLER_ERROR error = ARCONTROLLER_OK;
    ARCONTROLLER_Device_t *deviceController = data;
    u_int8_t cmdBuffer[ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE];
    int controllerLoopIntervalUs = 0;
    int mustBeSent = 0;

    // Check parameters
    if ((deviceController == NULL) || (deviceController->privatePart == NULL))
    {
        error = ARCONTROLLER_ERROR_BAD_PARAMETER;
    }
    // No Else: the checking parameters sets error to ARNETWORK_ERROR_BAD_PARAMETER and stop the processing

    if (error == ARCONTROLLER_OK)
    {
        controllerLoopIntervalUs = MSEC_TO_USEC (deviceController->privatePart->networkConfiguration.controllerLoopIntervalMs);
        if (!(controllerLoopIntervalUs > 0))
        {
            error = ARCONTROLLER_ERROR;
        }
    }

    if (error == ARCONTROLLER_OK)
    {
        while ((deviceController->privatePart->state == ARCONTROLLER_DEVICE_STATE_RUNNING) ||
               (deviceController->privatePart->state == ARCONTROLLER_DEVICE_STATE_STARTING) ||
               (deviceController->privatePart->state == ARCONTROLLER_DEVICE_STATE_PAUSED))
        {
            usleep (controllerLoopIntervalUs);

            if (deviceController->privatePart->state != ARCONTROLLER_DEVICE_STATE_RUNNING)
                continue;

            ARSAL_Mutex_Lock(&(deviceController->privatePart->mutex));

            if (deviceController->aRDrone3 != NULL)
            {
                mustBeSent = ARCONTROLLER_NAckCbs_ARDrone3PilotingPCMDMustBeSent (deviceController->aRDrone3);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_ARDrone3_SendPilotingPCMDStruct (deviceController->aRDrone3, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send PCMD : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

                mustBeSent = ARCONTROLLER_NAckCbs_ARDrone3CameraOrientationMustBeSent (deviceController->aRDrone3);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_ARDrone3_SendCameraOrientationStruct (deviceController->aRDrone3, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send Orientation : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

                mustBeSent = ARCONTROLLER_NAckCbs_ARDrone3CameraOrientationV2MustBeSent (deviceController->aRDrone3);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_ARDrone3_SendCameraOrientationV2Struct (deviceController->aRDrone3, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send OrientationV2 : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

                mustBeSent = ARCONTROLLER_NAckCbs_ARDrone3CameraVelocityMustBeSent (deviceController->aRDrone3);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_ARDrone3_SendCameraVelocityStruct (deviceController->aRDrone3, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send Velocity : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

            }

            if (deviceController->controller_info != NULL)
            {
                mustBeSent = ARCONTROLLER_NAckCbs_ControllerInfoGpsMustBeSent (deviceController->controller_info);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_ControllerInfo_SendGpsStruct (deviceController->controller_info, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send gps : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

                mustBeSent = ARCONTROLLER_NAckCbs_ControllerInfoBarometerMustBeSent (deviceController->controller_info);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_ControllerInfo_SendBarometerStruct (deviceController->controller_info, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send barometer : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

            }

            if (deviceController->jumpingSumo != NULL)
            {
                mustBeSent = ARCONTROLLER_NAckCbs_JumpingSumoPilotingPCMDMustBeSent (deviceController->jumpingSumo);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_JumpingSumo_SendPilotingPCMDStruct (deviceController->jumpingSumo, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send PCMD : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

            }

            if (deviceController->miniDrone != NULL)
            {
                mustBeSent = ARCONTROLLER_NAckCbs_MiniDronePilotingPCMDMustBeSent (deviceController->miniDrone);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_MiniDrone_SendPilotingPCMDStruct (deviceController->miniDrone, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send PCMD : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

            }

            if (deviceController->powerup != NULL)
            {
                mustBeSent = ARCONTROLLER_NAckCbs_PowerupPilotingPCMDMustBeSent (deviceController->powerup);
                if (mustBeSent)
                {
                    error = ARCONTROLLER_Powerup_SendPilotingPCMDStruct (deviceController->powerup, cmdBuffer, ARCONTROLLER_DEVICE_DEFAULT_LOOPER_CMD_BUFFER_SIZE);
                    if (error != ARCONTROLLER_OK)
                    {
                        ARSAL_PRINT (ARSAL_PRINT_ERROR, ARCONTROLLER_DEVICE_TAG, "Error occured while send PCMD : %s", ARCONTROLLER_Error_ToString (error));
                    }
                }

            }

            ARSAL_Mutex_Unlock(&(deviceController->privatePart->mutex));
        }
    }

    return NULL;
}

eARCONTROLLER_ERROR ARCONTROLLER_Device_AddCallbackInList (ARCONTROLLER_Device_STATECHANGEDCALLBACKELEMENT_t **callbackList, ARCONTROLLER_Device_StateChangedCallback_t callback, void *customData)
{
    // -- Add callback in array --

    // Local declarations
    eARCONTROLLER_ERROR error = ARCONTROLLER_OK;
    ARCONTROLLER_Device_STATECHANGEDCALLBACKELEMENT_t *newElement = NULL;

    // Add the callback
    newElement = malloc (sizeof(ARCONTROLLER_Device_STATECHANGEDCALLBACKELEMENT_t));
    if (newElement != NULL)
    {
        newElement->callback = callback;
        newElement->customData = customData;
        DL_APPEND ((*callbackList), newElement);
    }
    else
    {
        error = ARCONTROLLER_ERROR_ALLOC;
    }

    return error;
}

